import React, { useState, useEffect } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { Container, TextField, Button, Grid } from '@mui/material';
import GoogleLogin from 'react-google-login';
import FacebookLogin from 'react-facebook-login';
import { gapi } from 'gapi-script';
import './Loader.css'; // Import your CSS for the loader styling

const LoginScreen = () => {
  const history = useHistory();
  const clientId = '223407551839-u5p661d3dn6noi04668sf1aude820lqe.apps.googleusercontent.com';
  const [loading, setLoading] = useState(false); // Set initial loading state to false

  useEffect(() => {
    gapi.load('auth2', () => {
      gapi.auth2.init({ client_id: clientId });
    });
  }, [clientId]);

  const handleGoogleLoginSuccess = (response) => {
    setLoading(true); // Set loading to true when starting Google login process

    // Simulate a loading delay for demonstration purposes
    setTimeout(() => {
      const userData = {
        name: response.profileObj.name,
        email: response.profileObj.email,
        profilePicture: response.profileObj.imageUrl,
      };

      history.push({
        pathname: '/LoginSucess',
        state: { user: userData },
      });

      setLoading(false); // Set loading to false after the login process is completed
    }, 2000); // Adjust the delay as needed
  };

  const handleGoogleLoginFailure = (response) => {
    console.log(response);
  };

  return (
    <div>
      <div className="login-screen-container">
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
          <path fill="#ff5500" fillOpacity="1" d="M0,256L1440,64L1440,0L0,0Z"></path>
        </svg>
        <Container maxWidth="xs">
          <Grid container spacing={2} justifyContent="center" alignItems="center" className="login-form-container">
            <Grid item xs={12}>
              <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0px 2px 10px rgba(0, 0, 0, 0.1)' }}>
                <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', marginBottom: '20px' }}>
                  <h2 style={{ textAlign: 'center' }}>Login</h2>
                </div>
                <TextField label="Email" variant="outlined" fullWidth />
                <TextField label="Senha" type="password" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
                <Button variant="contained" color="secondary" fullWidth style={{ marginTop: '20px' }}>
                  Login
                </Button>
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '20px' }}>
                  <Link to="/cadastro" style={{ textDecoration: 'none', marginBottom: '10px', width: '100%' }}>
                    <Button variant="contained" color="secondary" fullWidth>
                      Criar uma conta
                    </Button>
                  </Link>
                  {loading ? (
                    <div className="progress"></div>
                  ) : (
                    <>
                      <GoogleLogin
                        clientId="223407551839-u5p661d3dn6noi04668sf1aude820lqe.apps.googleusercontent.com"
                        onSuccess={handleGoogleLoginSuccess}
                        onFailure={handleGoogleLoginFailure}
                        buttonText="Google"
                        fullWidth
                      />
                      {/* ... (Rest of your code) */}
                    </>
                  )}
                </div>
              </div>
            </Grid>
          </Grid>
        </Container>
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
          <path fill="#ff5500" fillOpacity="1" d="M0,256L1440,64L1440,320L0,320Z"></path>
        </svg>
      </div>
    </div>
  );
};

export default LoginScreen;
